import React from "react";

let inputElements = ["FirstName", "SecondName", "Age", "Country"];

export class PersonalInformation extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
            <div>
                {inputElements.map((input, i) => (<li key={i}>
                    <input
                    type="text"
                    name={input}

                    placeholder={input}

                    />

                </li>))}
                <button>Submit</button>
            </div>
        )
    }
}
